import './App.css';

function App() {
  return (
    <>
    <Router>
        <Routes>
          <helo>hcd </helo>
          <Route path="/" element={<Start />} />
          <Route path="/product" element={<Product />} />
          <Route path="/Cart" element={<Cart />} />
        </Routes>
      </Router>
    </>
  );
}

export default App;
